import React, { useState } from 'react';
import axios from 'axios';

const Register = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [username, setUsername] = useState(''); // Added username state
    const [error, setError] = useState('');
    const [registered, setRegistered] = useState(false);

    const handleRegister = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:3000/register', {
                email,
                password,
                username, // Include username in the request
            });
            console.log('Register response:', response);
            if (response.data) {
                setRegistered(true);
            } else {
                setError('Registration failed.');
            }
        } catch (error) {
            console.error('Error registering:', error);
            setError(error.response?.data?.message || 'An error occurred.');
        }
    };

    return (
        
        <div className="min-h-screen flex flex-col justify-center items-center">
            <h1 className="text-5xl font-bold mb-4 bg-gradient-to-r from-emerald-400 to-indigo-600 bg-clip-text text-transparent">GoFiber</h1>
            <h1 className="text-2xl font-bold mb-4 bg-gradient-to-r from-pink-300 to-indigo-600 bg-clip-text text-transparent">Register</h1>
            <form onSubmit={handleRegister} className="bg-white p-6 rounded shadow-md w-80">
                <div className="mb-4">
                    <label className="block text-gray-700">Email</label>
                    <input
                        type="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        className="w-full px-3 py-2 border rounded"
                        required
                    />
                </div>

                <div className="mb-4">
                <form action="#">
  <div class="w-60 h-12 relative flex rounded-xl">
    <input
      required=""
      class="peer w-full bg-transparent outline-none px-4 text-base rounded-xl bg-white border border-[#4070f4] focus:shadow-md"
      id="address"
      type="text"
    />
    <label
      class="absolute top-1/2 translate-y-[-50%] bg-white left-4 px-2 peer-focus:top-0 peer-focus:left-3 font-light text-base peer-focus:text-sm peer-focus:text-[#4070f4] peer-valid:-top-0 peer-valid:left-3 peer-valid:text-sm peer-valid:text-[#4070f4] duration-150"
      for="address"
    >
      Email Address</label
    >
  </div>
</form>
                </div>
                <div className="mb-4">
                    <label className="block text-gray-700">User Name</label>
                    <input
                        type="text"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        className="w-full px-3 py-2 border rounded"
                        required
                    />
                </div>
                <div className="mb-4">
                    <label className="block text-gray-700">Password</label>
                    <input
                        type="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        className="w-full px-3 py-2 border rounded"
                        required
                    />
                </div>
                {error && <p className="text-red-500 mb-4">{error}</p>}
                {registered && <p className="text-green-500 mb-4">Registration successful! You can now log in.</p>}
                <button
                    type="submit"
                    className="cursor-pointer transition-all bg-blue-500 text-white px-6 py-2 rounded-lg
